actionConfiguration.body:
() => {
		let ret = []
		let table = appsmith.store.unexpectedSerialsTable
		let row = table[tableUnexpectedSerials.selectedRowIndex] 

		if (row.Owner == "" || row.Owner == null) {
			let line = {
				"material": {"code": row.Material},
				"status": {"code": row.Status},
				"jobResponse": {"id": HandleJobResponses.activeJobResponse()},
				"quantity": 1,
				"user": {"id": GetUserSites.data.data.getUser.id},
				"materialSubLot": {"code": row.Serial}
			}
			ret.push(line)
		} else {
			let line = {
				"material": {"code": row.Material},
				"status": {"code": row.Status},
				"jobResponse": {"id": HandleJobResponses.activeJobResponse()},
				"quantity": 1,
				"owner": {"id": row.OwnerId},
				"user": {"id": GetUserSites.data.data.getUser.id},
				"materialSubLot": {"code": row.Serial}
			}
			ret.push(line)

		}
		return ret
	}

